Plea hearing proceeds.  Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant sworn, examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights and addendum to plea questionnaire received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty as charged in the Amended Information and ordeed a Judgment of Conviction be entered into the record.    

Sentencing proceeded.  Statements by the State, defense and defendant.  The Court imposed the following:

The Court sentenced defendant to serve 7 months at the House of Correction, with Huber for work and school; 3 days credit.  Court STAYED said sentence and placed defendant on probation for one (1) year.  

CONDITIONS OF PROBATION:
 - Undergo a mental health evaluation and follow any treatment recommended;
 - Remain controlled substance and alcohol free.  Should defendant test positive, the Court recommends revocation;
 - Urine screens;
 - AODA assessment and treatment;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - No contact with Antonio R.;
 - Obtain high school diploma, HSED or GED;
 - Cognitive thinking intervention counseling;
 - Court imposed 30 days condition time for any violations;
 - Pursuant to 951.18, Wis. Stats., defendant may not own, possess or train any animal for one (1) year;
 - Do not take anyone else's animals;
 - Pay the DNA surcharge, costs and disbursements.  Failure to pay would result in a civil judgment entered against defendant.

Court set restitution of zero.

Filed,
Notice of Right to Seek Postconviction Relief;
Pretrial Incarceration Credit.
